// import React from "react"
import ReactDOM from "react-dom/client"
import "./style.css"




const root=ReactDOM.createRoot(document.getElementById("root"))


  //navbar component
  function Navbar(){
    return(
      <nav>
        <h1>Perfumy</h1>
        <ul>
          <li>Home |</li>
          <li>Product |</li>
          <li>About |</li>
          <li>Contact |</li>

        </ul>
      </nav>

  )}

  //search components

  function Search(){
    return(
      <div className="Search">
        <input type="text" placeholder="search"/>       

      </div>
    )
  }

  //image components
  function img(){
    return(
      <div>
        <img src="./images/" alt="" />
      </div>
    )
  }

  //products

   <div class="products">

            <div class="box">

                        <img src="./images/img1.jpg"></img>
                        <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p>    
            </div>

            <div class="box">
                <img src="./images/img2.jpg" alt="villain"></img>
                <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p> 
            </div>
            <div class="box">
                <img src="./images/two.jpg" alt="Designs Club"></img>
                <p>Designer Club-Be Spoke by Perfume Lounge Men's Perfume | Premium Long Lasting Perfume</p>
            </div>


        </div>

  root.render(
    <div>
      <Navbar></Navbar>
      <Search></Search>
    </div>


  )
